import React from "react";
import Edit from "./components/Edit";
import Profile from "./components/Profile";

function App() {
  const people = [
    { name: "Alice", title: "Software Developer" },
    { name: "Bob", title: "Graphic Designer" },
    { name: "Charlie", title: "Data Analyst" },
    { name: "David", title: "Product Manager" },
    { name: "Eva", title: "Web Developer" },
    { name: "Frank", title: "UI/UX Designer" },
    { name: "Grace", title: "Marketing Specialist" },
    { name: "Henry", title: "System Administrator" },
    { name: "Irene", title: "Content Writer" },
    { name: "Jack", title: "Business Analyst" },
  ];

  return <Profile />;
}

export default App;
